export default function MiniProfile({userData}) {
    const StausDot = ({color}) => {
        let fillHelper = `fill-current text-${color} stroke-0.1`
        return(
            <svg xmlns="http://www.w3.org/2000/svg" version="1.1" width="64" height="64">
                <circle r="30" cx="32" cy="32" className={fillHelper}/>
            </svg>

        )
    }
    const user = userData || {
        first_name: 'Sam',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }
    return(
        <div className="flex mt-2 justify-end w-full h-12">
            <img className='w-12 h-12 rounded-full' src={user.avatar}/>
            <div className="grid grid-cols-1 grid-rows-3 h-10 ml-3 font-f1 text-sm w-auto">
                <p className='text-c1'>Welcome, {user.first_name}!</p>
                <p className='font-thin'>{user.city}</p>
                <p className='font-thin c1'><StatusDot color='green'/></p>
            </div>
        </div>
    )
}
